import React, { useEffect, useRef, useState } from "react";

const EYE_LEFT = [362, 385, 387, 263, 373, 380];
const EYE_RIGHT = [33, 160, 158, 133, 153, 144];

function calculateEAR(landmarks, eyeIndices) {
  const [p1, p2, p3, p4, p5, p6] = eyeIndices.map((i) => landmarks[i]);
  const vertical1 = Math.hypot(p2.x - p6.x, p2.y - p6.y);
  const vertical2 = Math.hypot(p3.x - p5.x, p3.y - p5.y);
  const horizontal = Math.hypot(p1.x - p4.x, p1.y - p4.y);
  return (vertical1 + vertical2) / (2 * horizontal);
}

const EAR_THRESHOLD = 0.25; // 상황에 따라 조정
const CONSEC_FRAMES = 2; // 연속 프레임 수 (깜빡임 판정)

const ViewCamera = () => {
  const videoRef = useRef(null);
  const [blinkCount, setBlinkCount] = useState(0);
  const [ear, setEar] = useState(0);
  const [frameCounter, setFrameCounter] = useState(0);

  // MediaPipe 스크립트 로드 및 FaceMesh 초기화
  useEffect(() => {
    // MediaPipe FaceMesh 스크립트 동적 로드
    const script = document.createElement("script");
    script.src =
      "https://cdn.jsdelivr.net/npm/@mediapipe/face_mesh/face_mesh.js";
    script.async = true;
    document.body.appendChild(script);

    let faceMesh = null;
    let animationId = null;

    script.onload = () => {
      // window.FaceMesh를 통해 객체 생성
      faceMesh = new window.FaceMesh({
        locateFile: (file) =>
          `https://cdn.jsdelivr.net/npm/@mediapipe/face_mesh/${file}`,
      });

      faceMesh.setOptions({
        maxNumFaces: 1,
        refineLandmarks: true,
        minDetectionConfidence: 0.5,
        minTrackingConfidence: 0.5,
      });

      faceMesh.onResults(onResults);

      // 웹캠 프레임 처리 루프 시작
      processFrame();
    };

    // 웹캠 프레임을 MediaPipe에 전달
    const processFrame = async () => {
      if (videoRef.current && videoRef.current.readyState === 4) {
        await faceMesh.send({ image: videoRef.current });
      }
      animationId = requestAnimationFrame(processFrame);
    };

    // 결과 처리 (깜빡임 판정)
    function onResults(results) {
      if (results.multiFaceLandmarks && results.multiFaceLandmarks[0]) {
        const landmarks = results.multiFaceLandmarks[0];
        const leftEAR = calculateEAR(landmarks, EYE_LEFT);
        const rightEAR = calculateEAR(landmarks, EYE_RIGHT);
        const avgEAR = (leftEAR + rightEAR) / 2;
        setEar(avgEAR);

        if (avgEAR < EAR_THRESHOLD) {
          setFrameCounter((prev) => prev + 1);
        } else {
          if (frameCounter >= CONSEC_FRAMES) {
            setBlinkCount((prev) => prev + 1);
          }
          setFrameCounter(0);
        }
      }
    }

    // 정리(clean-up)
    return () => {
      document.body.removeChild(script);
      if (animationId) cancelAnimationFrame(animationId);
    };
    // eslint-disable-next-line
  }, []);

  // 웹캠 연결
  useEffect(() => {
    async function setupWebcam() {
      if (navigator.mediaDevices.getUserMedia) {
        const stream = await navigator.mediaDevices.getUserMedia({
          video: true,
        });
        if (videoRef.current) {
          videoRef.current.srcObject = stream;
        }
      }
    }
    setupWebcam();
  }, []);

  return (
    <div style={{ position: "relative", width: 640, height: 480 }}>
      <video
        ref={videoRef}
        autoPlay
        playsInline
        width={640}
        height={480}
        style={{ border: "1px solid #ccc" }}
      />
      <div
        style={{
          position: "absolute",
          top: 20,
          left: 20,
          color: "white",
          backgroundColor: "rgba(0,0,0,0.5)",
          padding: 10,
          borderRadius: 8,
        }}
      >
        <div>Blink Count: {blinkCount}</div>
        <div>EAR: {ear.toFixed(3)}</div>
      </div>
      {ear < EAR_THRESHOLD && (
        <div
          style={{
            position: "absolute",
            top: "40%",
            left: "50%",
            transform: "translate(-50%,-50%)",
            fontSize: 40,
            color: "red",
            fontWeight: "bold",
            background: "rgba(255,255,255,0.3)",
            padding: 20,
            borderRadius: 10,
          }}
        >
          BLINKING!
        </div>
      )}
    </div>
  );
};

export default ViewCamera;
